module top_rtds_axis_0_0_two_flop_synchronizer
   (out,
    SR,
    tx_inprogress_1d_reg,
    aresetn,
    Clk100M,
    UserTxInProgress,
    tx_inprogress_1d);
  output out;
  output [0:0]SR;
  output tx_inprogress_1d_reg;
  input aresetn;
  input Clk100M;
  input UserTxInProgress;
  input tx_inprogress_1d;

  wire Clk100M;
  wire [0:0]SR;
  wire UserTxInProgress;
  wire aresetn;
  (* MAXDELAY = "4.800000" *) (* async_reg = "true" *) wire meta_signal;
  (* async_reg = "true" *) wire meta_signal_1d;
  wire tx_inprogress_1d;
  wire tx_inprogress_1d_reg;

  assign out = meta_signal_1d;
  LUT1 #(
    .INIT(2'h1)) 
    \m_axis_tdata[31]_i_2 
       (.I0(meta_signal_1d),
        .O(SR));
  (* ASYNC_REG *) 
  (* KEEP = "yes" *) 
  FDRE #(
    .INIT(1'b0)) 
    meta_signal_1d_reg
       (.C(Clk100M),
        .CE(1'b1),
        .D(meta_signal),
        .Q(meta_signal_1d),
        .R(1'b0));
  (* ASYNC_REG *) 
  (* KEEP = "yes" *) 
  (* maxdelay = "4.8 ns" *) 
  FDRE #(
    .INIT(1'b0)) 
    meta_signal_reg
       (.C(Clk100M),
        .CE(1'b1),
        .D(aresetn),
        .Q(meta_signal),
        .R(1'b0));
  LUT3 #(
    .INIT(8'hB8)) 
    tx_inprogress_1d_i_1
       (.I0(UserTxInProgress),
        .I1(meta_signal_1d),
        .I2(tx_inprogress_1d),
        .O(tx_inprogress_1d_reg));
endmodule
